import React from 'react';

export default function AdminHome() {
  return (
    <div>
      <h1>Welcome Admin</h1>
      <button onClick={() => { window.location.href = '/login'; }}>Logout</button>
      <button onClick={() => { window.location.href = '/expertRegistrtion'; }}>Expert Registration</button>
    </div>
  );
}
